import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input and type a query
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'Your Profile');

    // Take a screenshot after filling the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click on the "Your Profile" link
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take a screenshot after clicking the profile link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_page.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || '';
      const fullName = document.querySelector('.profile-info h2')?.textContent || '';
      const email = 'jun@example.com'; // Hardcoded for demonstration
      return { username, fullName, email };
    });

    return {
      success: true,
      action: "Navigated to User Profile and extracted information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
